    [],nt"num_tags": 4,nt"name": "lake-andes-national-wildlife-refuge-annual-narrative-report-calendar-year-1981",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Lake Andes
    NWR, Lake Andes WMD, and Karl E. Mundt NWR outlines Refuge accomplishments during
    the 1981 calendar year. The report begins with a summary of the year's highlights
    and weather conditions. Land acquisition is covered. The report includes a planning
    section which discusses research and investigations. Refuge administration is outlined;
    information about personnel, funding, safety, and technical assistance is given.
    Habitat management is also covered; subjects include wetlands, forests, croplands,
    grasslands, grazing, haying, fire management, pest control, and WPA easements. The
    wildlife section of the report discusses wildlife diversity, endangered and threatened
    species, waterfowl, marsh birds and waterbirds, shorebirds, raptors, game mammals,
    fisheries resources, and disease control. The public uses of the Refuge described
    in this report include interpretive programs, hunting, fishing, trapping, wildlife
    observation, and law enforcement. The equipment and facilities section of the report
    provides information about new construction, rehabilitation, major maintenance,
    equipment replacement, communication systems, and energy conservation. Cooperative
    programs and items of interest are provided at the end. Refuge brochures and newspaper
    articles are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
